import * as React from "react";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";
import Box from "@mui/material/Box";
import NotificationsActiveRoundedIcon from "@mui/icons-material/NotificationsActiveRounded"; //tab1 alarm
import AccountCircleRoundedIcon from "@mui/icons-material/AccountCircleRounded"; //tab2 member
import StarRoundedIcon from "@mui/icons-material/StarRounded"; //tab3 BookMark&MileStone
import RouteRoundedIcon from "@mui/icons-material/RouteRounded"; //tab4 myTask
import CommentRoundedIcon from "@mui/icons-material/CommentRounded"; //tab5 comment

const Sidebar = () => {
    const [value, setValue] = React.useState("one");

    const handleChange = (event: React.SyntheticEvent, newValue: string) => {
        setValue(newValue);
    };

    return (
        <Box sx={{ display: "flex" }}>
            <Tabs sx={{ minWidth: "200px" }} value={value} onChange={handleChange} aria-label="sidebar tabs">
                <Tab value="one" icon={<NotificationsActiveRoundedIcon />} label="Tab 1" />
                <Tab value="two" icon={<AccountCircleRoundedIcon />} label="Tab 2" />
                <Tab value="three" icon={<StarRoundedIcon />} label="Tab 3" />
                <Tab value="four" icon={<RouteRoundedIcon />} label="Tab 4" />
                <Tab value="five" icon={<CommentRoundedIcon />} label="Tab 5" />
            </Tabs>
            <Box sx={{ flex: 1, padding: "16px" }}>
                {value === "one" && (
                    <Box>
                        <div>Tab 1 Content</div>
                    </Box>
                )}
                {value === "two" && (
                    <Box>
                        <div>Tab 2 Content</div>
                    </Box>
                )}
                {value === "three" && (
                    <Box>
                        <div>Tab 3 Content</div>
                    </Box>
                )}
                {value === "four" && (
                    <Box>
                        <div>Tab 4 Content</div>
                    </Box>
                )}
                {value === "five" && (
                    <Box>
                        <div>Tab 5 Content</div>
                    </Box>
                )}
            </Box>
        </Box>
    );
};

export default Sidebar;
